import './index.scss';
import "react-toastify/ReactToastify.min.css";
import React from 'react';
import ReactDOM from 'react-dom/client';
import LoginComponent from './pages/login/login.page';
import { RouterProvider } from 'react-router';
import { createBrowserRouter } from 'react-router-dom';
import ConnectionDetailsComponent from './pages/connection-details/connection-details.component';
import SearchResultPage from './pages/search-result/search-result.page';
import { ToastContainer } from 'react-toastify';
import NotFoundPage from './pages/not-found/not-found.page';
import AuthGuard from './guards/auth/auth.guard';
import App from './pages/dashboard/dashboard.page'

console.log(sessionStorage.getItem('isAuthenticated'));

const router = createBrowserRouter([
  {
    path: "/",
    element: <AuthGuard auth={(sessionStorage.getItem("isAuthenticated"))}><App /></AuthGuard>
  },
  {
    path:"/login",
    element: <LoginComponent/>
  },
  {
    path: "/connection",
    element: <AuthGuard auth={{isAuthenticated: JSON.parse(sessionStorage.getItem("isAuthenticated"))}}><ConnectionDetailsComponent /></AuthGuard>
  },
  {
    path: "/search",
    element: <AuthGuard auth={{isAuthenticated: JSON.parse(sessionStorage.getItem("isAuthenticated"))}}><SearchResultPage /></AuthGuard>
  },
  {
    path: "*",
    element: <NotFoundPage />
  }

]);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>
    <ToastContainer />
    <RouterProvider router={router} />
  </>,
);
